import '../stylesheets/components/Footer.scss';

function Footer() {
  return (
    <div className="Footer">
        <a href="https://www.linkedin.com/in/cosmina-iosifescu/" target="_blank" className="link">
          <i className="fab fa-linkedin-in"></i>
        </a>
        <a href="https://github.com/limecoconutz" target="_blank"  className="link">
          <i className="fab fa-github"></i>
        </a>
    </div>
  );
}

export default Footer;
